import { Food } from "../models/Food";
import { TestListElementBox } from "../styles/OrderTrans";
import { SerifText, SerifTextL, SerifTextS } from "../styles/TextStyles";
import { priceAll } from "./functions/priceAll";

export const SummaryList = ({ data }: any) => {
  return (
    <div style={{ marginTop: "5%" }}>
      {data.map((item: any) => (
        <TestListElementBox>
          <div style={{ flex: 2 }}>
            <SerifText>{item.name}</SerifText>
          </div>
          <div style={{ flex: 1 }}>
            <SerifText>x{item.amount}</SerifText>
          </div>
          <div style={{ flex: 1 }}>
            <SerifText>{item.price * item.amount}$</SerifText>
          </div>
        </TestListElementBox>
      ))}
      <SerifTextL>Suma: {priceAll(data)}$</SerifTextL>
    </div>
  );
};
